import React, {useEffect, useState} from "react";
import axios from "axios";
import {Link} from "react-router-dom";

function Main() {
const [test, setTest] = useState([])

    useEffect(() => {
      axios("/api/tests/get-all-test").then(({data}) => {
          setTest(data)
      })
    },[])

  return (
    <div className="container">
        <div className="row">
            <ul>
                {
                    test?.map(it => {
                        return (
                            <Link className="p-2 text-light text-decoration-none" to={`/test/${it}`}>
                                <li className="p-5 bg-list">
                                    {it}
                                </li>
                            </Link>

                        )
                    } )
                }
            </ul>

        </div>
    </div>
  )
}

export default Main;
